        lastMarker.bindPopup(t.lastPopup || ('ShipId: ' + t.id));
        boundsGroup.push(lastMarker);
      }
    }

    if (trianglePoints.length > 0) {
      new TriangleCanvasLayer(trianglePoints).addTo(map);
    }

    if (boundsGroup.length > 0) {
      const group = L.featureGroup(boundsGroup);
      map.fitBounds(group.getBounds().pad(0.2));
    }
  </script>
</body>
</html>
